<h3>Te mostramos algunas de los productos que preparamos para ella...</h3>\r\n<a href=\"http://www.laslechuzas.com.ar/wp-content/uploads/2015/10/12202490_749559655150135_353619781_n.jpg\"><img class=\"alignnone size-medium wp-image-247\" src=\"http://www.laslechuzas.com.ar/wp-content/uploads/2015/10/12202490_749559655150135_353619781_n-300x199.jpg\" alt=\"12202490_749559655150135_353619781_n\" width=\"300\" height=\"199\" /></a> <a href=\"http://www.laslechuzas.com.ar/wp-content/uploads/2015/10/12181986_749559071816860_2063568211_n.jpg\"><img class=\"alignnone size-medium wp-image-246\" src=\"http://www.laslechuzas.com.ar/wp-content/uploads/2015/10/12181986_749559071816860_2063568211_n-300x199.jpg\" alt=\"12181986_749559071816860_2063568211_n\" width=\"300\" height=\"199\" /></a> <a href=\"http://www.laslechuzas.com.ar/wp-content/uploads/2015/10/12049533_619814454826956_6059095238610750902_n.jpg\"><img class=\"alignnone size-medium wp-image-245\" src=\"http://www.laslechuzas.com.ar/wp-content/uploads/2015/10/12049533_619814454826956_6059095238610750902_n-300x168.jpg\" alt=\"12049533_619814454826956_6059095238610750902_n\" width=\"300\" height=\"168\" /></a>\r\n\r\n&nbsp;','Cumple de Lucrecia :)','','inherit','closed','closed','','239-revision-v1','','','2015-10-29 23:39:52','2015-10-30 02:39:52','',239,'http://www.laslechuzas.com.ar/2015/10/29/239-revision-v1/',0,'revision','',0),(250,1,'2015-10-30 19:52:27','2015-10-30 22:52:27','<h3>Que lindo es ver la verdura fresca, su colores, sentir su aroma. Unas de las cosas que mas valoramos en nuestra cocina es que todos los ingredientes que vamos a usar sean frescos. Tenemos lugares de confianza donde sabemos que vamos a encontrarlos y hasta lo que llevamos de recorrido nunca nos han fallado.</h3>\r\n<h3>En el gusto se siente todo, los sabores no mienten. Cuando las cosas están hechas a las corridas o cuando uno esta cansado o malhumorado, en el producto final se ve la diferencia. Por eso todo lo que hacemos esta hecho con dedicación y cariño, queremos que te lleves el mejor recuerdo de nosotros.\r\nTe invito a que nos conozcas :)</h3>','Frescura','','publish','open','open','','frescura','','','2015-10-30 19:52:27','2015-10-30 22:52:27','',0,'http://www.laslechuzas.com.ar/?p=250',0,'post','',0),(251,1,'2015-10-30 19:51:52','2015-10-30 22:51:52','','IMG_20151030_152732860','','inherit','open','closed','','img_20151030_152732860','','','2015-10-30 19:51:52','2015-10-30 22:51:52','',250,'http://www.laslechuzas.com.ar/wp-content/uploads/2015/10/IMG_20151030_152732860.jpg',0,'attachment','image/jpeg',0),(252,1,'2015-10-30 19:52:12','2015-10-30 22:52:12','<h3>Que lindo es ver la verdura fresca, su colores, sentir su aroma. Unas de las cosas que mas valoramos en nuestra cocina es que todos los ingredientes que vamos a usar sean frescos. Tenemos lugares de confianza donde sabemos que vamos a encontrarlos y hasta lo que llevamos de recorrido nunca nos han fallado.</h3>\r\n<h3>En el gusto se siente todo, los sabores no mienten. Cuando las cosas están hechas a las corridas o cuando uno esta cansado o malhumorado, en el producto final se ve la diferencia. Por eso todo lo que hacemos esta hecho con dedicación y cariño, queremos que te lleves el mejor recuerdo de nosotros.\r\nTe invito a que nos conozcas :)</h3>','Frescura','','inherit','closed','closed','','250-revision-v1','','','2015-10-30 19:52:12','2015-10-30 22:52:12','',250,'http://www.laslechuzas.com.ar/2015/10/30/250-revision-v1/',0,'revision','',0),(253,1,'2015-11-01 00:19:52','2015-11-01 03:19:52','<h3><span style=\"color: #000000;\">Hoy realizamos un pedido muy especial. No porque sea para un familiar o porque nosotras vayamos a comer algo de lo preparado. Es especial porque se depositó la confianza en lo que hacemos para el festejo de lo mas preciado. </span>\r\n<span style=\"color: #000000;\">Rocío mañana festeja el cumple de su pequeña y decidió que nosotras participemos en el lunch para ese evento tan espacial. Esperamos haber cumplido las expectativas para esa mamá; mañana lo sabremos. Gracias por la confianza!</span></h3>\r\n<h3>Fue día de amasar y amasar, muchos chips, muchas pizzetas. Hoy por primera vez necesitamos colaboradores para terminar, día inusual. Les compartimos algunas cosas que realizamos hoy. Saludos.</h3>\r\n&nbsp;\r\n\r\n<a href=\"http://www.laslechuzas.com.ar/wp-content/uploads/2015/11/IMG_20151031_172645691.jpg\"><img class=\"alignnone size-medium wp-image-255\" src=\"http://www.laslechuzas.com.ar/wp-content/uploads/2015/11/IMG_20151031_172645691-300x169.jpg\" alt=\"IMG_20151031_172645691\" width=\"300\" height=\"169\" /></a> <a href=\"http://www.laslechuzas.com.ar/wp-content/uploads/2015/11/IMG_20151031_180114098.jpg\"><img class=\"alignnone size-medium wp-image-256\" src=\"http://www.laslechuzas.com.ar/wp-content/uploads/2015/11/IMG_20151031_180114098-300x169.jpg\" alt=\"IMG_20151031_180114098\" width=\"300\" height=\"169\" /></a> <a href=\"http://www.laslechuzas.com.ar/wp-content/uploads/2015/11/IMG_20151031_183047904.jpg\"><img class=\"alignnone size-medium wp-image-257\" src=\"http://www.laslechuzas.com.ar/wp-content/uploads/2015/11/IMG_20151031_183047904-300x169.jpg\" alt=\"IMG_20151031_183047904\" width=\"300\" height=\"169\" /></a> <a href=\"http://www.laslechuzas.com.ar/wp-content/uploads/2015/11/IMG_20151031_190346245.jpg\"><img class=\"alignnone size-medium wp-image-258\" src=\"http://www.laslechuzas.com.ar/wp-content/uploads/2015/11/IMG_20151031_190346245-169x300.jpg\" alt=\"IMG_20151031_190346245\" width=\"169\" height=\"300\" /></a> <a href=\"http://www.laslechuzas.com.ar/wp-content/uploads/2015/11/IMG_20151031_195102491.jpg\"><img class=\"alignnone size-medium wp-image-259\" src=\"http://www.laslechuzas.com.ar/wp-content/uploads/2015/11/IMG_20151031_195102491-300x169.jpg\" alt=\"IMG_20151031_195102491\" width=\"300\" height=\"169\" /></a>\r\n\r\n&nbsp;','Confianza','','publish','open','open','','confianza','','','2015-11-01 00:30:33','2015-11-01 03:30:33'